function(el, x, data) {
  return (
    function(el, x) {
      var updateLegend = function () {
          var selectedGroup = document.querySelectorAll('input:checked')[0].nextSibling.innerText.substr(1);

          //document.querySelectorAll('.legend').forEach(a => a.hidden=true);
          //document.querySelectorAll('.legend').forEach(l => {
          document.querySelector('#geospatial').querySelectorAll('div.info.legend.leaflet-control').forEach(a => a.hidden=true);
          document.querySelector('#geospatial').querySelectorAll('div.info.legend.leaflet-control').forEach(l => {;
            if (l.children[0].children[0].innerText == 'Active cases (municipality)' & selectedGroup == 'Municipality') l.hidden=false;
            if (l.children[0].children[0].innerText == 'Active cases (LGA)' & selectedGroup == 'Local geographic area') l.hidden=false;

          });
      };

      // Attempted fix for if loade has directed to that pill
      window.addEventListener('DOMContentLoaded', (event) => {
        if(window.location.hash === '#geospatial') {
          updateLegend();
          document.querySelector('#geospatial').getElementsByClassName('leaflet-control-layers leaflet-control-layers-expanded leaflet-control')[[0]].style.marginBottom='25px';
        }
      });

      $("a[href='#geospatial']").on('shown.bs.tab', function(e) {

      updateLegend();
      document.querySelector('#geospatial').getElementsByClassName('leaflet-control-layers leaflet-control-layers-expanded leaflet-control')[[0]].style.marginBottom='25px';


      });

      this.on('baselayerchange', e => updateLegend());

      // Adjust attribution...
      document.querySelector('#geospatial').getElementsByClassName('leaflet-control-attribution')[[0]].style.fontSize='8px';
      document.querySelector('#geospatial').getElementsByClassName('leaflet-control-attribution')[[0]].style.width='99%';
    }).call(this.getMap(), el, x, data);
}

